    return (
      <div>
        <h1>Food</h1>

        <div>
          <img src = {require("./food_photos/blueberries.jpg")} style = {this.styles.image}/>
          <h2>Blueberries</h2>
          <p>kcal: 70</p>
          <p>Linked diseases: diabetes</p>
